-- ----------------------------
--  Table structure for `wireless_device_category`
-- ----------------------------
DROP TABLE IF EXISTS `wireless_device_category`;
CREATE TABLE `wireless_device_category` (
  `id` int(11) NOT NULL,
  `name` varchar(255) NOT NULL,
  `preDefined` tinyint(1) DEFAULT '1' COMMENT '是否系统定义0-否，1-是',
  `update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `node_group` varchar(50) DEFAULT NULL COMMENT '节点配置信息  用于界面展示效果',
  `isDefaultDisplay` tinyint(1) DEFAULT '1',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

